import React from 'react';
import {Redirect , Route} from 'react-router-dom';
import ls from 'local-storage';
import Cookie from 'js-cookie';
const PrivateRouteNonlogin = ({component: Component, ...rest}) => {
    return (
        <Route {...rest} render={props => (
            (Cookie.get('type')==='customer' || Cookie.get('type')==='') ?<Component {...props} />: <Redirect to="/insertproduct" />
        )} />
        
    );
};

export default PrivateRouteNonlogin;
